.larger-container {
  display: flex;
  flex-direction: column;
}
.header-padding-left {
  width: 70px;
}
.header-padding-right {
  width: 18px;
}
.container-header-row {
  display: flex;
  flex-direction: row;
}
.container-header {
  display: grid;
  width: 95%;
  background-color: transparent;
  grid-template-columns: 3.88% 19.42% 4.854% 19.42% 4.854% 19.42% 4.854% 19.42% 3.88%;
  grid-template-rows: 45px;
}
.container-body {
  display: grid;
  width: 95%;
  grid-template-columns: 3.88% 19.42% 4.854% 19.42% 4.854% 19.42% 4.854% 19.42% 3.88%;
  grid-template-rows: 4px repeat(105, 45px);
